class App extends Component {
  render() {
    return (
      <Fragment>
        <Switch>
          <Route exact path="/" component={MainPage} />
          {/* <PrivateRoute path="/private" component={PrivateRoutes} /> */}
          <Route path="/not-found" component={NotFound} />
          <Redirect to="/not-found" />
        </Switch>
      </Fragment>
    );
  }
}

export default App;
